  root: {
    display: 'flex',
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

function Start() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Login />
      <Singup />
    </div>

  )
}

